import React from 'react';
import SearchBar from './SearchBar';
import JobListing from './JobListing';

function Homepage() {
  const onSearch = () => {};

  function FilterJobSearch() {
    return (
      <div className="left-section">
        <ul class="list-unstyled">
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-house-door"></i> My Jobs</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-gear"></i> Preferences</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-bar-chart"></i> Demonstrate Skills</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-journal-bookmark"></i> Interview Prep</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-file-earmark-text"></i> Resume Builder</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-person"></i> Job Seeker Guidance</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-gear"></i> Application Settings</a></li>
      <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-upload"></i> Post a Job</a></li>
    </ul>
      </div>
    );
  }


  function suggestSearch(keyword) {
    document.getElementById('searchInput').value = keyword;
    searchJobs();
  }

  function searchJobs() {
    const searchTerm = document.getElementById('searchInput').value.toLowerCase();
    const jobListings = document.querySelectorAll('.job-listing');

    jobListings.forEach((listing) => {
      const title = listing.dataset.title.toLowerCase();

      if (title.includes(searchTerm)) {
        listing.style.display = 'block';
      } else {
        listing.style.display = 'none';
      }
    });
  }

  return (
    <div className="right-section">
      <SearchBar onSearch={onSearch} suggestSearch={suggestSearch} />

      <JobListing
        title="Barista"
        logoSrc="../../assets/apple.png"
        company="District Market UW West Campus"
        location="Seattle, WA"
        pay="$20,000 - $30,000 per year"
        qualifications="High School Diploma"
        posted="yesterday"
      />

     <JobListing
        title="Barista"
        logoSrc="/project-info340-group-7/project-draft/assets/apple.png"
        company="District Market UW West Campus"
        location="Seattle, WA"
        pay="$20,000 - $30,000 per year"
        qualifications="High School Diploma"
        posted="yesterday"
      />

     <JobListing
        title="Barista"
        logoSrc="/project-info340-group-7/project-draft/assets/apple.png"
        company="District Market UW West Campus"
        location="Seattle, WA"
        pay="$20,000 - $30,000 per year"
        qualifications="High School Diploma"
        posted="yesterday"
      />

     <JobListing
        title="Barista"
        logoSrc="/project-info340-group-7/project-draft/assets/apple.png"
        company="District Market UW West Campus"
        location="Seattle, WA"
        pay="$20,000 - $30,000 per year"
        qualifications="High School Diploma"
        posted="yesterday"
      />
    </div>
  );
}

export default Homepage;
